import { Link } from "react-router-dom";

function Navbar() {
    return (
        <nav class="navbar navbar-expand-md navbar-light">
          <div class="container-fluid">
            <a class="headline d-flex align-center"><img src="%PUBLIC_URL%/logo64.png" alt="history" height="45"/></a>
            <ul class="navbar-nav">
              <li class="nav-item">
                <Link to="/" class="nav-link">Home</Link>
              </li>
              <li class="nav-item">
                <Link to="/bram" class="nav-link">Bram Stoker</Link>
              </li>
            </ul>
            </div>
        </nav>
    )
}

export default Navbar;
